import React from 'react';

class Select extends React.Component {
  
  constructor(props) {
    super(props);
    this.state = {
      // isChecked:this.props.isChecked,
    };
  }

 
  render(){
    return (
			<div className="ui">
          <label>{this.props.text}</label> 
					<select>
						<option value="group1">{this.props.group[0]}</option>
						<option value="group2">{this.props.group[1]}</option>
						<option value="group3">{this.props.group[2]}</option>
					</select>
			</div>	
			);

  }
}

export default Select;
